import DataList from "../DataList";
import SectionCard from "../SectionCard";

const SuperUsuarioDashboard = ({ displayName, dashboardData }) => (
  <>
    <SectionCard
      title={`Hola, ${displayName}`}
      description="AdministraciÃ³n de microempresas y clientes."
    />
    <SectionCard title="Microempresas">
      <DataList
        items={(dashboardData?.microempresas || []).map((item) => ({
          id: item.tenant_id,
          label: `${item.nombre} (${item.email})`,
          meta: item.estado,
        }))}
        emptyLabel="Sin microempresas registradas."
      />
    </SectionCard>
    <SectionCard title="Clientes">
      <DataList
        items={(dashboardData?.clientes || []).map((item) => ({
          id: item.id,
          label: `${item.nombre} - ${item.razon_social}`,
          meta: item.estado,
        }))}
        emptyLabel="Sin clientes registrados."
      />
    </SectionCard>
  </>
);

export default SuperUsuarioDashboard;
